import React from 'react';

const Skills: React.FC = () => (
    <section
        id="skills"
        style={{
            background: "#f9f9f9",
            borderRadius: "8px",
            boxShadow: "0 2px 8px rgba(0,0,0,0.07)",
            padding: "32px",
            margin: "24px auto",
            maxWidth: "700px",
            boxSizing: "border-box"
        }}
    >
        <h2
            style={{
                color: "#333",
                fontSize: "2rem",
                marginBottom: "16px",
                textAlign: "center"
            }}
        >
            Skills
        </h2>
        <ul style={{ padding: 0, margin: 0, listStyle: "none" }}>
            <li style={{
                background: "#e3f2fd",
                borderRadius: "10px",
                padding: "16px",
                marginBottom: "16px",
                fontSize: "1.1rem",
                boxShadow: "0 2px 8px rgba(0,0,0,0.04)",
                textAlign: "center"
            }}>
                <strong>Languages:</strong> Java, C, Python
            </li>
            <li style={{
                background: "#e3f2fd",
                borderRadius: "10px",
                padding: "16px",
                marginBottom: "16px",
                fontSize: "1.1rem",
                boxShadow: "0 2px 8px rgba(0,0,0,0.04)",
                textAlign: "center"
            }}>
                <strong>Web Technology:</strong> ReactJs, ExpressJs, NodeJs, JavaScript, MongoDB, SQL, Firebase
            </li>
            <li style={{
                background: "#e3f2fd",
                borderRadius: "10px",
                padding: "16px",
                marginBottom: "16px",
                fontSize: "1.1rem",
                boxShadow: "0 2px 8px rgba(0,0,0,0.04)",
                textAlign: "center"
            }}>
                <strong>CS Fundamentals:</strong> Data Structures and Algorithms, OOPS, OS, DBMS
            </li>
            <li style={{
                background: "#e3f2fd",
                borderRadius: "10px",
                padding: "16px",
                marginBottom: "0",
                fontSize: "1.1rem",
                boxShadow: "0 2px 8px rgba(0,0,0,0.04)",
                textAlign: "center"
            }}>
                <strong>Developer Tools:</strong> Git, GitHub, VS Code, Postman, Vercel
            </li>
        </ul>
        {/* Responsive styling */}
        <style>
            {`
                @media (max-width: 600px) {
                    section#skills {
                        padding: 16px !important;
                        margin: 12px auto !important;
                    }
                    section#skills h2 {
                        font-size: 1.3rem !important;
                    }
                    section#skills ul li {
                        font-size: 1rem !important;
                        padding: 10px !important;
                    }
                }
            `}
        </style>
    </section>
);

export default Skills;
